(1, '$MONTO=($MONTOBASE*$PORCENTAJE)/100;', 3, 1, 'Retencion de Impuesto al Valor Agregado 75% Persona Juridica Domiciliada', '2010-01-01', 0, '2010-08-27 07:45:16', 'asys'),
